    false,nt"url": null,nt"notes": "Construct enclosures at Columbia Mine to
    house approximately 60 turtles (trans-located animals) that were collected off of
    the ROW for sections 2 and 4 of I-69. Monitor the behavior, survival and reproduction
    of trans-located box turtles during the captive phase of the new home-range adoption
    process. Determine the population and habit-use characteristics of the remnant,
    resident box turtle population at Columbia Mine. Determine the genetics profile
    of individual trans-located, resident and hatchling turtles and to conduct parentage
    analysis of hatchlings or eggs detected. Monitor the survival, movements and habitat
    use of post-release, trans-located turtles for 2 years post-release",nt"license_title":
